import "./CartItem.css";
import { Link } from "react-router-dom";

const CartItem = () => {
  return (
    <div className="cart-view">
      <div className="cart-image">
        <img
          src="https://images.unsplash.com/photo-1558756520-22cfe5d382ca?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80"
          alt="product name"
        />
      </div>

      <Link to={`/product/${11}`} className="cart-item-name">
        <p>Producto 1</p>
      </Link>

      <p className="cart-price">$499.99</p>
      <select className="cart-select">
        <option value="1">1</option>
        <option value="2">2</option>
        <option value="3">3</option>
        <option value="4">4</option>
      </select>
      <button className="cart-delete">
        <i className="fas fa-trash"></i>
      </button>
    </div>
  );
};

export default CartItem;
